      subroutine gufld(r,B)
      implicit none
      real r(3),B(3)
      real rr(3),rs(3),BB(3)
      integer iregion
      integer getMap
      external getMap

      real orig1(3),rmat1(3,3)
      data orig1/0,0,-1975/
      data rmat1/1,0,0,
     +          0,6.12303e-17,-1,
     +          0,1,6.12303e-17/
      real orig2(3),rmat2(3,3)
      data orig2/0,0,-1345/
      data rmat2/1,0,0,
     +          0,6.12303e-17,-1,
     +          0,1,6.12303e-17/
      real orig3(3),rmat3(3,3)
      data orig3/0,0,0/
      data rmat3/1,0,0,
     +          0,1,0,
     +          0,0,1/

      iregion = getMap()
      if (iregion.eq.0) then
        B(1) = 0
        B(2) = 0
        B(3) = 0
      else if (iregion.eq.1) then
        B(1) = 0
        B(2) = -2
        B(3) = 1.22461e-16
      else if (iregion.eq.2) then
        B(1) = 0
        B(2) = -2
        B(3) = 1.22461e-16
      else if (iregion.eq.3) then
		    call gufld2(r, B)
C        rs(1) = r(1)-orig3(1)
C        rs(2) = r(2)-orig3(2)
C        rs(3) = r(3)-orig3(3)
C        rr(1) = rs(1)*rmat3(1,1)+rs(2)*rmat3(1,2)+rs(3)*rmat3(1,3)
C        rr(2) = rs(1)*rmat3(2,1)+rs(2)*rmat3(2,2)+rs(3)*rmat3(2,3)
C        rr(3) = rs(1)*rmat3(3,1)+rs(2)*rmat3(3,2)+rs(3)*rmat3(3,3)
C        call gufld1(rr,BB)
C        B(1) = BB(1)*rmat3(1,1)+BB(2)*rmat3(2,1)+BB(3)*rmat3(3,1)
C        B(2) = BB(1)*rmat3(1,2)+BB(2)*rmat3(2,2)+BB(3)*rmat3(3,2)
C        B(3) = BB(1)*rmat3(1,3)+BB(2)*rmat3(2,3)+BB(3)*rmat3(3,3)
        B(1) = B(1)*10
        B(2) = B(2)*10
        B(3) = B(3)*10
      endif
      end

      subroutine gufld1(r,B)
      implicit none
      real r(3),B(3),Br(3)
      real rho,phi,alpha
      real u(3)
      real twopi
      parameter (twopi=6.28318530717959)

      real bound0(3,2)
      data bound0/0,0,10.16,
     +            101.6,6.28319,645.16/
      integer reverse0(3)
      data reverse0/1,1,1/
      real Bmap(3,41,1,251)
      integer nsites(3)
      data nsites/41,1,251/
      logical loaded
      data loaded/.false./
      save Bmap,nsites,loaded
      integer i,i1,i2,i3

      if (.not.loaded) then
        open(unit=78,file='solenoid.map',status='old',err=7)
        read(unit=78,fmt=*,err=5,end=6)
     +      ((((Bmap(i,i1,i2,i3),i=1,3),
     +         i3=1,251),
     +        i1=1,41),
     +       i2=1,1)
        go to 8
    5   stop 'error reading magnetic field map, stop'
    6   stop 'EOF encountered reading magnetic field map, stop'
    7   stop 'error opening magnetic field map, stop'
    8   loaded=.true.
      endif

      rho = sqrt(r(1)**2+r(2)**2)
      phi = atan2(r(2),r(1))
      u(1) = (rho-bound0(1,1))/(bound0(1,2)-bound0(1,1))
      u(2) = (phi-bound0(2,1))/(bound0(2,2)-bound0(2,1))
      alpha = abs(twopi/(bound0(2,2)-bound0(2,1)))
      u(2) = u(2)-int(u(2)/alpha)*alpha
      if (u(2).lt.0) then
        u(2) = u(2)+alpha
      endif
      u(3) = (r(3)-bound0(3,1))/(bound0(3,2)-bound0(3,1))
      if ((u(1).ge.0.and.u(1).le.1).and.
     +    (u(2).ge.0.and.u(2).le.1).and.
     +    (u(3).ge.0.and.u(3).le.1)) then
        call interpol3(Bmap,nsites,u,Br)
        Br(1)=Br(1)*reverse0(1)
        Br(2)=Br(2)*reverse0(2)
        B(1)=Br(1)*cos(phi)-Br(2)*sin(phi)
        B(2)=Br(2)*cos(phi)+Br(1)*sin(phi)
        B(3)=Br(3)*reverse0(3)
        return
      endif

      B(1) = 0
      B(2) = 0
      B(3) = 0
      return
      end

      subroutine interpol3(Bmap,nsites,u,B)
      implicit none
      integer nsites(3)
      real Bmap(3,nsites(1),nsites(2),nsites(3))
      real u(3),B(3)
      integer ir(3),ir0(3),ir1(3)
      real ur(3),dur(3),ugrad(3,3)
      integer i
      do i=1,3
        ur(i)=u(i)*(nsites(i)-1)+1
        ir(i)=nint(ur(i))
        ir0(i)=max(ir(i)-1,1)
        ir1(i)=min(ir(i)+1,nsites(i))
        dur(i)=(ur(i)-ir(i))/(ir1(i)-ir0(i)+1e-20)
      enddo
      ugrad(1,1)=(Bmap(1,ir1(1),ir(2),ir(3))-Bmap(1,ir0(1),ir(2),ir(3)))
      ugrad(2,1)=(Bmap(2,ir1(1),ir(2),ir(3))-Bmap(2,ir0(1),ir(2),ir(3)))
      ugrad(3,1)=(Bmap(3,ir1(1),ir(2),ir(3))-Bmap(3,ir0(1),ir(2),ir(3)))
      ugrad(1,2)=(Bmap(1,ir(1),ir1(2),ir(3))-Bmap(1,ir(1),ir0(2),ir(3)))
      ugrad(2,2)=(Bmap(2,ir(1),ir1(2),ir(3))-Bmap(2,ir(1),ir0(2),ir(3)))
      ugrad(3,2)=(Bmap(3,ir(1),ir1(2),ir(3))-Bmap(3,ir(1),ir0(2),ir(3)))
      ugrad(1,3)=(Bmap(1,ir(1),ir(2),ir1(3))-Bmap(1,ir(1),ir(2),ir0(3)))
      ugrad(2,3)=(Bmap(2,ir(1),ir(2),ir1(3))-Bmap(2,ir(1),ir(2),ir0(3)))
      ugrad(3,3)=(Bmap(3,ir(1),ir(2),ir1(3))-Bmap(3,ir(1),ir(2),ir0(3)))
      B(1)=Bmap(1,ir(1),ir(2),ir(3))
     +       +ugrad(1,1)*dur(1)+ugrad(1,2)*dur(2)+ugrad(1,3)*dur(3)
      B(2)=Bmap(2,ir(1),ir(2),ir(3))
     +       +ugrad(2,1)*dur(1)+ugrad(2,2)*dur(2)+ugrad(2,3)*dur(3)
      B(3)=Bmap(3,ir(1),ir(2),ir(3))
     +       +ugrad(3,1)*dur(1)+ugrad(3,2)*dur(2)+ugrad(3,3)*dur(3)
      end

      subroutine getoptical(imat,E,refl,absl,rind,plsh,eff)
      implicit none
      integer imat
      real E,refl,absl,rind,plsh,eff
      if (imat.eq.65) then
        call getoptical65(E,refl,absl,rind,plsh,eff)
      elseif (imat.eq.66) then
        call getoptical66(E,refl,absl,rind,plsh,eff)
      elseif (imat.eq.67) then
        call getoptical67(E,refl,absl,rind,plsh,eff)
      elseif (imat.eq.68) then
        call getoptical68(E,refl,absl,rind,plsh,eff)
      elseif (imat.eq.69) then
        call getoptical69(E,refl,absl,rind,plsh,eff)
      else
        refl = 0
        absl = 0
        rind = 0
        plsh = 1
        eff = 0
      endif
      end

      subroutine guplsh(medi0,medi1)
      implicit none
      integer medi0,medi1
      real E,refl,absl,rind,plsh,eff
      integer nmat
      character*20 natmed
      integer isvol,ifield
      real fieldm,tmaxfd,stemax,deemax,epsil,stmin
      integer nwbuf
      real ubuf(99)
      call GFTMED(medi1,natmed,nmat,isvol,ifield,fieldm,
     +  tmaxfd,stemax,deemax,epsil,stmin,ubuf,nwbuf)
      E = 2.5
      call getoptical(nmat,E,refl,absl,rind,plsh,eff)
      end
